  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115000 includes chemical,
  discrete sample, physical and profile data collected from THOMAS WASHINGTON in the
  Monterey Bay National Marine Sanctuary, North Pacific Ocean and South Pacific Ocean
  from 1991-05-31 to 1991-07-11 and retrieved during cruise TUNES_1 and WOCE_P17C.
  These data include ALKALINITY, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12
  (CFC-12), DELTA CARBON-13, DELTA CARBON-14, DELTA HELIUM-3, DISSOLVED INORGANIC
  CARBON, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE,
  Potential temperature (theta), SALINITY, SILICATE, Tritium (Hydrogen isotope) and
  WATER TEMPERATURE. The instruments used to collect these data include CTD and bottle.
  These data were collected by Catherine Goyet of University of Perpignan via Domitia;
  Institute of Modeling and Analysis of Geo-Environment and Health as part of the
  WOCE_P17C data set.nnThe World Ocean Circulation Experiment (WOCE) was a major component
  of the World Climate Research Program with the overall goal of better understanding
  the ocean's role in climate and climatic changes resulting from both natural and
  anthropogenic causes. The CO2 survey took advantage of the sampling opportunities
  provided by the WOCE Hydrographic Program (WHP) cruises during this period between
  1990 and 1998. The final collection covers approximately 23,000 stations from 94
  WOCE cruises.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
